import React from "react";
import '../../styles/Manage/UsersList.css';
import SimpleBar from "simplebar-react";
import 'simplebar/dist/simplebar.min.css';

export default class Userlist extends React.Component {

    constructor(props) {
        super(props);
    }


    render() {
        return (
            <div className={'User_list_view_mian'}>
               <div className={'User_list_view_headbar'}>
                   <h1>Użytkownicy</h1>
               </div>
                <div className={'User_list_view_mian_body'}>
                    <table className={'User_list_view_mian_body_table'}>
                        {/*<colgroup>*/}
                        {/*    <col span="1" style={{width: "460px"}}/>*/}
                        {/*    <col span="1" style={{width: "140px"}}/>*/}
                        {/*</colgroup>*/}
                        <thead>
                            <tr >
                                <th style={{width: '5%', whiteSpace: 'nowrap'}} >ID</th>
                                <th >Nazwa</th>
                                <th style={{width: '200px'}}>Typ</th>
                                <th style={{width: '200px'}}></th>
                            </tr>
                        </thead>
                    </table>
                    <SimpleBar forceVisible="y"  autoHide={false} style={{width: '100%', maxHeight: '500px', overflowX: 'hidden'}}>
                        {/*<table style={{overflowX: 'hidden'}} className={'Sharelesson_main_view_table'}>*/}
                        <table className={'User_list_view_mian_body_table'}>
                            {/*<colgroup>*/}
                            {/*    <col span="1" style={{width: "50%"}}/>*/}
                            {/*    <col span="1" style={{width: "50%"}}/>*/}
                            {/*</colgroup>*/}
                            <tbody>
                                <tr>
                                    <th>
                                        <a>1</a>
                                    </th>
                                    <th>
                                        <a>Michał Ratajewski</a>
                                    </th>
                                    <th>
                                        <a>Administrator</a>
                                    </th>
                                    <th>
                                        <button>
                                            Edytuj
                                        </button>
                                        <button>
                                            Usuń
                                        </button>
                                    </th>
                                </tr>
                            </tbody>
                        </table>
                    </SimpleBar>
                </div>
            </div>
        )
    }

}
